mapper.select:
select 

from 
(select t.*,rownumber() over() as rn from T_COOPERATION_DEBT t

	
	   	and t.RUNITID = #{runitid,jdbcType=VARCHAR} 
	
	
	   	and t.BUSINESSLICENCE = #{businesslicence,jdbcType=VARCHAR} 
	
	
	   	and t.ORGANCODE = #{organcode,jdbcType=VARCHAR} 
	
 
 )
 
 	
    	rn between #{start} and #{end}
